import{_ as t,a}from"./chunks/rtk_cuav_c-rtk_to_6pin_connector.CPckekK7.js";import{_ as r,c as e,o as d,ab as o}from"./chunks/framework.CUflZczI.js";const S=JSON.parse('{"title":"CUAV C-RTK","description":"","frontmatter":{},"headers":[],"relativePath":"uk/gps_compass/rtk_gps_cuav_c-rtk.md","filePath":"uk/gps_compass/rtk_gps_cuav_c-rtk.md"}'),s={name:"uk/gps_compass/rtk_gps_cuav_c-rtk.md"},i=o('<h1 id="cuav-c-rtk" tabindex="-1">CUAV C-RTK <a class="header-anchor" href="#cuav-c-rtk" aria-label="Permalink to &quot;CUAV C-RTK&quot;">​</a></h1><p>GPS-приймач <a href="https://www.cuav.net/en/c_rtk_9ps/" target="_blank" rel="noreferrer">CUAV C-RTK</a> - це <a href="./../gps_compass/rtk_gps.html">RTK GPS-модуль</a> для масового ринку. Повна система RTK складається щонайменше з двох модулів C-RTK (один для базової станції, а інший для літака). Використовуючи RTK, PX4 може визначати своє місцезнаходження з точністю до сантиметра, що набагато точніше, ніж може забезпечити звичайний GPS.</p><img src="'+t+'" width="500px" title="C-RTK"><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><ul><li><a href="https://item.taobao.com/item.htm?id=565380634341&amp;spm=2014.21600712.0.0" target="_blank" rel="noreferrer">cuav taobao</a></li><li><a href="https://www.aliexpress.com/store/product/CUAV-NEW-Flight-Controller-GPS-C-RTK-differential-positioning-navigation-module-GPS-for-PIX4-Pixhawk-pixhack/3257035_32853894248.html?spm=2114.12010608.0.0.75592fadQKPPEn" target="_blank" rel="noreferrer">cuav aliexpress</a></li></ul><h2 id="налаштування" tabindex="-1">Налаштування <a class="header-anchor" href="#налаштування" aria-label="Permalink to &quot;Налаштування&quot;">​</a></h2><p>Налаштування та використання RTK на PX4 за допомогою <em>QGroundControl</em> відбувається за принципом «підключи і працюй» (див. <a href="./../gps_compass/rtk_gps.html">RTK GPS</a> для отримання додаткової інформації).</p><h2 id="підключення-та-з-єднання" tabindex="-1">Підключення та з&#39;єднання <a class="header-anchor" href="#підключення-та-з-єднання" aria-label="Permalink to &quot;Підключення та з&#39;єднання&quot;">​</a></h2><p>C-RTK GPS поставляється з кабелем, який закінчується 6-контактним роз&#39;ємом і 4-контактним роз&#39;ємом, сумісним з <a href="https://doc.cuav.net/flight-controller/pixhack/en/quick-start-pixhack-v3x.html#gps--compass" target="_blank" rel="noreferrer">Pixhack v3</a>. 6-контактний роз&#39;єм забезпечує інтерфейс для RTK GPS і повинен бути підключений до GPS-порту польотного контролера. 4-контактний роз&#39;єм - це GPS-інтерфейс m8n (стандартний), який призначений для (додаткового) використання в якості другого GPS.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>На момент написання цієї статті PX4 ще не повністю підтримує другий GPS. 4-контактний порт не потрібно підключати.</p></div><img src="'+a+'" width="500px" title="C-RTK_6PIN"><p>Може знадобитися модифікація кабелів/роз&#39;ємів для підключення до інших плат польотних контролерів. Нижче наведено схеми підключення виводів для <em>Pixhawk 3 Pro</em> і <em>Pixracer</em>.</p><h3 id="розпіновка" tabindex="-1">Розпіновка <a class="header-anchor" href="#розпіновка" aria-label="Permalink to &quot;Розпіновка&quot;">​</a></h3><p>Нижче наведено розводку GPS-приймача C-RTK. Це може бути використано для модифікації роз&#39;єму для інших плат автопілота.</p><table><thead><tr><th>pin</th><th>C-RTK GPS 6P</th><th>pin</th><th>Pixhawk 3 Pro GPS</th><th>C-RTK GPS 4P</th></tr></thead><tbody><tr><td>1</td><td>SDA</td><td>1</td><td>VCC</td><td></td></tr><tr><td>2</td><td>SCL</td><td>2</td><td>GPS_TX</td><td></td></tr><tr><td>3</td><td>GPS_RX</td><td>3</td><td>GPS_RX</td><td>GPS_RX</td></tr><tr><td>4</td><td>GPS_TX</td><td>4</td><td>SCL</td><td>GPS_TX</td></tr><tr><td>5</td><td>VCC_5V</td><td>5</td><td>SDA</td><td>VCC_5v</td></tr><tr><td>6</td><td>GND</td><td>6</td><td>GND</td><td>GND</td></tr></tbody></table>',15),c=[i];function h(l,_,p,n,m,P){return d(),e("div",null,c)}const f=r(s,[["render",h]]);export{S as __pageData,f as default};
